import React from 'react';
import ReactDOM from 'react-dom/client';

const Hello = (props) => {
  return (
    <div>
      <p>Hello {props.name}</p>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <h1>Greetings</h1>
      <Hello name="George" />
      <Hello name="Daisy" />
    </div>
  )
}

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render( <App />);
